INSERT INTO `recipe` (`id`, `created_date`, `modified_date`, `content`, `description`, `minute`, `nickname`, `password`, `photo`, `star`, `title`, `price`) VALUES
	(67, '2022-05-18 11:33:05.764000', '2022-05-18 11:33:05.764000', '["신라면 볶음면을 뜨거운 물에 담아 3분 조리합니다.","이후 천하장사 소세지를 잘라서 넣어 같이 비벼 먹습니다."]', '소세지 햄을 이용한 신라면 요리입니다', 4, 'Rockstar', '1', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/046a9d0e-a32d-4df1-936e-edbb6784a2e9.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/5ebc01d8-cc21-4ef4-9ec7-5681ca568817.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/b273ed17-6f37-44e3-a5ce-0a7e726959d9.png', NULL, '햄치즈 신라면 볶음', 3600),
	(68, '2022-05-18 13:01:31.297000', '2022-05-18 13:01:31.297000', '["쿠키를 잘 게 부숩니다","그 후 에이스에 올려 먹습니다"]', '초콜릿 쿠키와 뉴치케', 2, 'Rockstar', '1', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/3a662b9c-82ef-42e8-8f15-5939d00ad792.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/bf77e51e-d4c6-428a-a344-715e0cfb52b8.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/8373c86b-c6a9-4cee-8274-41cb778ee058.png', NULL, '뉴욕 치즈 케이크 초콜릿', 2200),
	(69, '2022-05-18 13:06:03.835000', '2022-05-18 13:06:03.835000', '["라면 볶이를 3분간 뜨거운 물에서 조리한다","치즈를 올려 녹여 먹는다"]', '치즈와 라면 볶이의 최고의 조합', 5, 'Rockstar', '1', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/e56d79f2-575e-425e-9516-e9e25d920fd7.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/0af8396b-725b-484e-b998-162109f7ab54.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/e1035a75-d7e5-47a8-b057-74a85b66f86a.png', NULL, '맛있는 치즈 라면', 2900),
	(70, '2022-05-18 13:15:05.501000', '2022-05-18 13:15:05.501000', '["먼저 요플레를 그릇에 200g 담습니다.","그 후 100g의 냉동 블루베리를 부어서 같이 휘저어 먹습니다."]', '블루베리와 요거트를 혼합하여 지방은 줄이고 단백질은 높였다.', 5, 'Rockstar', '1', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/603c49db-0bc6-451b-a6b6-f88e8ae98fff.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/ff86293e-f26a-4e3c-91c2-6cb79ea24526.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/a3c29a3e-d270-49a5-9522-c54ac0bce4f5.png', NULL, '다이어트 식이 최적 블루베리 요거트', 5200),
	(71, '2022-05-18 13:18:43.677000', '2022-05-18 13:18:43.677000', '["샐러드를 우선 준비합니다.","닭가슴살을 무칩니다."]', '다이어트 최적의 요리', 10, 'Rockstar', '1', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/27413645-c82a-4c0b-af35-6faf69289052.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/5591dc8e-0cd4-4a2c-b753-9d39d593bb11.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/057b696b-4ea2-43cf-a115-3d644820b83a.png', NULL, '닭가슴살 단호박 무침', 5000),
	(72, '2022-05-18 15:18:37.448000', '2022-05-18 15:18:37.448000', '["쫄면 볶이를 5분동안 조리한다","용기를 내서 젤리를 넣어본다"]', '젤리와 쫄면 볶이', 8, 'Rockstar', '1', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/a28851a3-458f-4771-a14a-a8b689a1d311.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/199c074d-d3a8-44bd-85d4-2f2c4db2f93b.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/3dfc8b04-5979-4c60-9d5d-338dfa9d2ec4.png', NULL, '젤리 면 볶이', 6000),
	(74, '2022-05-19 16:42:24.987000', '2022-05-19 16:42:24.987000', '["까르보 불닭 볶음면을 제조합니다","스파게티를 제조합니다","맛있게 섞으면 끝~"]', '까르보 불닭볶음면과 스파게티의 조합!', 5, '편의점 푸드파이터', '1234', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/8afe06e6-c1fe-4f20-adb7-813580ca7c6e.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/e0fb202c-83d4-431b-91b5-cb5b9ba17e50.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/5946a8c7-e643-4911-a54f-4f9b4495a647.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/1e04299f-cff5-4c1e-9f5b-38cf5d3edc6c.png', NULL, '까르보 불닭 게티', 3100),
	(77, '2022-05-20 02:33:12.576000', '2022-05-20 02:33:12.576000', '["불닭 볶음면을 미리 조리해줍니다 단! 면이 약간 덜익어야합니다","매콤한 맛을 중화시킬 초코를 넣어줍니다!","치즈와 초코의 묵직함을 잡아줄 상큼한 젤리를 넣습니다","전자레인지에 2분돌리면 완성!"]', '묵직한 바디감의 초코와 상큼한 젤리가 매콤한 불닭과 조화를!', NULL, '타스타드', '1234', 'https://storage.cloud.google.com/bool1-d964f.appspot.com/649f9921-6579-401d-a6b7-b011a378e7f8.png,https://storage.cloud.google.com/bool1-d964f.appspot.com/162e8cf9-3f21-4bf1-bee6-9b44dae78500.jpg,https://storage.cloud.google.com/bool1-d964f.appspot.com/200fe932-dc24-4624-b3f2-6f3d8d3c20a7.jpg,https://storage.cloud.google.com/bool1-d964f.appspot.com/849bd960-323e-48c5-9603-15bae23b67f9.jpg,https://storage.cloud.google.com/bool1-d964f.appspot.com/2eb36f81-f7ba-46b1-b102-b651c953be2a.jpg', NULL, '초코 젤리 라면', 5600);
